export function Shutdown()
{
    //channel 0
    var packet = [];

    packet[0x00] = 0x00;
    packet[0x01] = 0x38;
    packet[0x02] = 0x00;
    packet[0x03] = 0x01;

    device.write(packet, 65);
    //channel 1
    var packet2 = [];

    packet2[0x00] = 0x00;
    packet2[0x01] = 0x38;
    packet2[0x02] = 0x01;
    packet2[0x03] = 0x01;

    device.write(packet2, 65);


}

function StreamLightingPacketChanneled(start, count, colorChannel, data, channel)
{
    //channel selection == 32 0/1 Start Count Channel LEDS
    //(Start, Count, Color, Data)
    var packet = [];

    packet[0x00]   = 0x00;
    packet[0x01]   = 0x32;
    packet[0x02]   = channel;
    packet[0x03]   = start;
    packet[0x04]   = count;
    packet[0x05]   = colorChannel;

    packet = packet.concat(data);

    device.write(packet, 65);
}



